import React from 'react';
import Navbar from "../pages/Navbar";
import Footer from "../pages/Footer";
import Aboutpage from "../pages/About";



function About() {
    return (
        <div>
            <br></br>
            <br></br>
            <Navbar/>
             <Aboutpage/>
            <Footer/>
        </div>
    )
}

export default About;
